class Stack {

 private class Node {

 int data;

 Node next;

 }

 public class Stack {

 int size;

 private Node head;

 public boolean isEmpty() {

 return size == 0;

 }

 public int getSize() {

 return size;

 }

 public void push(int data) {

 if (head == null) {

 head = new Node();

 head.data = data;

 head.next = null;

 } else {

 head = new Node();

 head.data = data;

 head.next = head;

 }

 size++;

